import classes from './OneThumbnail.module.css';
import picture from './Thumbnail.jpg';

const OneThumbnail = ({ item, onClick }) => {
  return (
    <div className={classes.mainContainer} onClick={onClick}>
      <div className={classes.bodyContainer}>
        <div className={classes.textContainer}>
          {item.title} {/* Display the title or any other information */}
        </div>
        <div className={classes.imageContainer}>
          <img className={classes.imageInput} src={picture} alt="Thumbnail" />
        </div>
      </div>
    </div>
  );
};

export default OneThumbnail;
